import React from 'react';
import './App.css';
import Home from './Component/home/home';
import Header from './Component/home/header/header';

class App extends React.Component {
	constructor(props) {
		super(props);
	}

	/** Render this app first app component run */
	render() {
		return (
			<div>
				{/** Render Home Component */}
				<Header/>
				<Home />
			</div>
		)
	}
}
export default App;
